करेन्ट लागेर मोरङमा एक जनाको मृत्यु भएको छ ।&amp;nbsp;

धनपालथान गाउँपालिका-४ कर्सिया बस्ने ५० वर्षीय सानबहादुर दमाइको करेन्ट लागेर मंगलबार दिउँसो मृत्यु भएको हो ।

सोही ठाउँस्थित कनक फर्निचर उद्योगमा बिजुलीको मिटर सफा गर्ने क्रममा करेन्ट लागेर गम्भीर घाइते भएका उनको स्थानीय कट्टेल मेडिकल कर्सियामा उपचारका क्रममा मृत्यु भएको प्रहरीले जनाएको छ ।&amp;nbsp;

